  useEffect(() => {
    fetch('http://localhost:3000/users')
        .then(r => r.json())
        .then(usersArray => {
            setUsers(usersArray);
        })
  }, [])


    const userAcquisitions =
    users.map((eachUser) => {
        return <AcquisitionsList
            key={thisUser.id}
            userCollection={thisUser.acquisitions}
            thisUser={thisUser}
            currentUser={currentUser} 
            onAcquireArtwork={onAcquireArtwork}
            />
    })

    return (
        <div >
           {userAcquisitions}
        </div>
    );
    }
